"1391":{"id":"1391","name":"E Sua Mãe Também","slug":"e-sua-mae-tambem","original_title":"Y tu mamá también","overview":"Tenoch e Julio são dois adolescentes de 17 anos que são controlados pelos seus hormônios e desejam se tornar adultos rapidamente. Em uma tarde festiva eles encontram Luisa, uma garota espanhola 11 anos mais velha que eles e que é casada com o primo de Tenoch. Eles a convidam para uma viagem à praia de Boca del Cielo, convite este inicialmente recusado e posteriormente aceito, após Luisa receber uma desagradável notícia. Porém, tanto Julio quanto Tenoch não conhecem o caminho até a praia e nem mesmo se ela realmente existe, fazendo com que os três se aventurem em uma viagem onde inocência, sexualidade e amizade irão colidir.","first_air_date":"2001-06-08","runtime":105,"episode_run_time":[105],"vote_average":7.4,"created_by":["Bésame Mucho Pictures","Anhelo Productions"],"production_companies":[{"name":"Bésame Mucho Pictures"},{"name":"Anhelo Productions"}],"cast":["Diego Luna","Gael García Bernal","Maribel Verdú","Daniel Giménez Cacho","Diana Bracho"],"backdrop_path":"https://image.tmdb.org/t/p/original/orIxqUMEcU3DT7qCs16Si8KWjBO.jpg","poster_path":"https://image.tmdb.org/t/p/original/cBxIm0aF4MdRD7atLNHryq1WvOW.jpg","certification":"18","genres":["Drama","Romance"],"trailer":"N/A"},
