"37724":{"id":"37724","name":"007 Operação Skyfall","slug":"007-operacao-skyfall","original_title":"Skyfall","overview":"Após uma missão mal sucedida de James Bond, a identidade de agentes secretos é revelada e o M16, atacado. Ajudado por um agente de campo, Bond deverá seguir a trilha de Silva, um homem que habita o passado de M e que tem contas a acertar.","first_air_date":"2012-10-24","runtime":143,"episode_run_time":[143],"vote_average":7.2,"created_by":["Metro-Goldwyn-Mayer","EON Productions","Danjaq","Columbia Pictures"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"},{"name":"EON Productions"},{"name":"Danjaq"},{"name":"Columbia Pictures"}],"cast":["Daniel Craig","Judi Dench","Javier Bardem","Ralph Fiennes","Naomie Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/mgcbG1w3lgj9lajGBXVUjLQti8P.jpg","poster_path":"https://image.tmdb.org/t/p/original/dMquqnvnvwuugB5z8zP7uyyNYUl.jpg","certification":"14","genres":["Ação","Aventura","Thriller"],"trailer":"N/A"},
"9543":{"id":"9543","name":"Príncipe da Pérsia: As Areias do Tempo","slug":"principe-da-persia-as-areias-do-tempo","original_title":"Prince of Persia: The Sands of Time","overview":"Na cidade sagrada de Alamut ficam as Areias do Tempo, que dá aos mortais o poder de voltar ao passado. Após liderar um ataque à cidade, Dastan, o filho adotivo do rei da Pérsia, consegue uma adaga que lhe dá acesso às Areias. Dastan foge com uma princesa Alamut chamada Tamina após ser acusado de matar o pai. O casal precisa proteger o tesouro antigo e desmascarar o assassino do rei.","first_air_date":"2010-05-19","runtime":116,"episode_run_time":[116],"vote_average":6.3,"created_by":["Walt Disney Pictures","Jerry Bruckheimer Films"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Jerry Bruckheimer Films"}],"cast":["Jake Gyllenhaal","Gemma Arterton","Ben Kingsley","Alfred Molina","Steve Toussaint"],"backdrop_path":"https://image.tmdb.org/t/p/original/6sZAhoIrcoM6g372S15Idcja0Hv.jpg","poster_path":"https://image.tmdb.org/t/p/original/nJxserrGJEJSBzLRs4YMMN0OakZ.jpg","certification":"12","genres":["Aventura","Fantasia","Ação"],"trailer":"N/A"},
