"1593":{"id":"1593","name":"Uma Noite no Museu","slug":"uma-noite-no-museu","original_title":"Night at the Museum","overview":"Quando Larry Daley é contratado como guarda noturno no museu, ele logo descobre que todos os seres do museu ganham vida após o pôr-do-sol. Logo de cara, Larry se vê frente a frente com um brincalhão esqueleto de T. Rex, mas também é cercado por exércitos de minúsculos soldados romanos e por caubóis armados. Para completar, há um macaquinho endiabrado que o deixa maluco! Mas talvez ele consiga descobrir um modo de controlar o caos e tornar-se um herói aos olhos de seu filho.","first_air_date":"2006-12-20","runtime":108,"episode_run_time":[108],"vote_average":6.6,"created_by":["1492 Pictures","21 Laps Entertainment","20th Century Fox","Ingenious Media","Sun Canada Productions"],"production_companies":[{"name":"1492 Pictures"},{"name":"21 Laps Entertainment"},{"name":"20th Century Fox"},{"name":"Ingenious Media"},{"name":"Sun Canada Productions"}],"cast":["Ben Stiller","Carla Gugino","Dick Van Dyke","Mickey Rooney","Bill Cobbs"],"backdrop_path":"https://image.tmdb.org/t/p/original/1ZVlzOBYCggLzvVYHK7Im6LohjC.jpg","poster_path":"https://image.tmdb.org/t/p/original/Pca1hVNgPAUcp6zVHldlboh80R.jpg","certification":"L","genres":["Ação","Aventura","Comédia","Família","Fantasia"],"trailer":"N/A"},
