"967":{"id":"967","name":"Spartacus","slug":"spartacus","original_title":"Spartacus","overview":"Spartacus, um homem que nasceu escravo, labuta para o Império Romano enquanto sonha com o fim da escravidão. Ele foi condenado à morte por morder um guarda em uma mina na Líbia. Mas seu destino foi mudado por um lanista (negociante e treinador de gladiadores), que o comprou para ser treinado nas artes de combate e se tornar um gladiador. Até que um dia, dois poderosos patrícios chegam de Roma, um com a esposa e o outro com a noiva. As mulheres pedem para serem entretidas com dois combates até à morte e Spartacus, é escolhido para enfrentar um gladiador negro, que vence a luta mas se recusa a matar seu opositor, atirando seu tridente contra a tribuna onde estavam os romanos. Este nobre gesto custa a vida do gladiador negro e enfurece Spartacus, de tal maneira que ele acaba liderando uma revolta de escravos, que atinge metade da Itália.","first_air_date":"1960-10-13","runtime":197,"episode_run_time":[197],"vote_average":7.5,"created_by":["Bryna Productions","Universal Pictures"],"production_companies":[{"name":"Bryna Productions"},{"name":"Universal Pictures"}],"cast":["Kirk Douglas","Laurence Olivier","Jean Simmons","Charles Laughton","Peter Ustinov"],"backdrop_path":"https://image.tmdb.org/t/p/original/aheSIG4h3JNxWeDvdb1NxKzgjaM.jpg","poster_path":"https://image.tmdb.org/t/p/original/7Ia2ziy1juSFsl3ZCaaRn15Yo2A.jpg","certification":"12","genres":["História","Guerra","Drama","Aventura"],"trailer":"N/A"},
"2671":{"id":"2671","name":"O Chamado","slug":"o-chamado","original_title":"リング","overview":"Após a morte de Tomoko Oishi, uma repórter, Reiko Asakawa, ouve histórias de um vídeo que mata quem o vê uma semana exatamente após assisti-lo. No início não dá importância aos rumores, mas ao descobrir que um amigo de Tomoko, que assistiu o vídeo, morreu exatamente uma semana depois ela começa a investigar. Após ver a fita estranhas coisas começam a acontecer.","first_air_date":"1998-01-31","runtime":96,"episode_run_time":[96],"vote_average":7.1,"created_by":["KADOKAWA Shoten","Omega Project","Rasen Production Committee"],"production_companies":[{"name":"KADOKAWA Shoten"},{"name":"Omega Project"},{"name":"Rasen Production Committee"}],"cast":["松嶋菜々子","Hiroyuki Sanada","大高力也","中谷美紀","竹内結子"],"backdrop_path":"https://image.tmdb.org/t/p/original/sGhbO6muh1Fnpa7nkxYCfvmgWCo.jpg","poster_path":"https://image.tmdb.org/t/p/original/syLg5jXxTton9i1gbgTW5Io0U6L.jpg","certification":"14","genres":["Terror","Thriller"],"trailer":"N/A"},
