"8835":{"id":"8835","name":"Legalmente Loira","slug":"legalmente-loira","original_title":"Legally Blonde","overview":"Elle Woods namora o mais bonito garoto de seu colégio, Warner Huntington III, com quem inclusive planeja se casar no futuro. Mas Elle tem um problema que incomoda Warner: ela é fútil demais! Até que, quando Warner vai estudar Direito na Universidade de Harvard, ele passa a namorar uma nova garota e decide largar Elle, que não se dá por vencida e decide estudar a fim de também passar para o curso de Direito e ainda por cima provar sua inteligência.","first_air_date":"2001-07-13","runtime":96,"episode_run_time":[96],"vote_average":6.8,"created_by":["Metro-Goldwyn-Mayer","Marc Platt Productions"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"},{"name":"Marc Platt Productions"}],"cast":["Reese Witherspoon","Luke Wilson","Selma Blair","Matthew Davis","Victor Garber"],"backdrop_path":"https://image.tmdb.org/t/p/original/hRn3BLeIYGPh4EYcKTi7rmGQ4iO.jpg","poster_path":"https://image.tmdb.org/t/p/original/zlieYqoBgbcIhYT8CgSGu4QRXWw.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
"181283":{"id":"181283","name":"Crimes Ocultos","slug":"crimes-ocultos","original_title":"Child 44","overview":"Durante o governo stalinista na União Europeia, um oficial da segurança ouve falar de um país onde o número de assassinatos de crianças é muito alto, a ponto de se considerar a existência de um serial killer. O Estado não quer saber do caso, que pode ter conexões com altos funcionários do governo, e exila o oficial para que ele não possa prosseguir com a análise dos fatos. No entanto, este homem obstinado decide chamar a sua esposa para investigarem o caso por conta própria.","first_air_date":"2015-03-15","runtime":137,"episode_run_time":[137],"vote_average":6.3,"created_by":["Summit Entertainment","Worldview Entertainment","Lionsgate","Scott Free Productions"],"production_companies":[{"name":"Summit Entertainment"},{"name":"Worldview Entertainment"},{"name":"Lionsgate"},{"name":"Scott Free Productions"}],"cast":["Tom Hardy","Gary Oldman","Noomi Rapace","Fares Fares","Joel Kinnaman"],"backdrop_path":"https://image.tmdb.org/t/p/original/sjsaxwNsgBbrWrJIXtCT5DNo9Mt.jpg","poster_path":"https://image.tmdb.org/t/p/original/4SLbUr8qlbODbiuuyixpy8rytTb.jpg","certification":"16","genres":["Crime","Thriller"],"trailer":"N/A"},
"668":{"id":"668","name":"007 A Serviço Secreto de Sua Majestade","slug":"007-a-servico-secreto-de-sua-majestade","original_title":"On Her Majesty's Secret Service","overview":"Em uma praia, James Bond (George Lazenby) evita que uma jovem mulher cometa suicídio. O pai dela é o chefe de uma poderosa organização criminosa e, impressionado com Bond, quer que ele proteja sua filha se casando com ela. Em troca, ele oferece ao famoso agente informações que o façam chegar até Ernst Blofeld (Telly Savallas), o principal inimigo do agente. Inicialmente, James Bond concorda com o acordo, visando apenas poder matar Blofeld, mas com o tempo ele realmente fica apaixonado pela sua futura esposa. Porém, James Bond logo descobre que Blofeld planeja destruir a humanidade com um vírus altamente mortal a menos que receba perdão por todos os seus crimes. Desta maneira, a Rainha da Inglaterra pede que o agente secreto mais famoso do mundo intervenha no caso, mas a situação se complica e toma um rumo inesperado.","first_air_date":"1969-12-18","runtime":142,"episode_run_time":[142],"vote_average":6.6,"created_by":["EON Productions","United Artists"],"production_companies":[{"name":"EON Productions"},{"name":"United Artists"}],"cast":["George Lazenby","Diana Rigg","Telly Savalas","Gabriele Ferzetti","Ilse Steppat"],"backdrop_path":"https://image.tmdb.org/t/p/original/1kdyLiE2Mqt7cxnivdPX3qckvfW.jpg","poster_path":"https://image.tmdb.org/t/p/original/vPkS9X0qaPDaHSke0Ji4UJRk9Ye.jpg","certification":"12","genres":["Aventura","Ação","Thriller"],"trailer":"N/A"},
"18823":{"id":"18823","name":"Fúria de Titãs","slug":"furia-de-titas","original_title":"Clash of the Titans","overview":"Perseu (Sam Worthington) descobre que é o filho mortal de Zeus (Liam Neeson), mas recusa-se a aceitar tal condição. Contudo, para salvar a cidade de Argos da fúria dos deuses do olimpo e da vingança de seu tio Hades (Ralph Fiennes), ele vai ter que enfrentar uma perigosa jornada contra terríveis criaturas como a Medusa para salvar os simples mortais e a bela Andrômeda (Alexa Davalos) do sacrifício para o monstro Kraken.","first_air_date":"2010-03-26","runtime":106,"episode_run_time":[106],"vote_average":5.9,"created_by":["The Zanuck Company","Legendary Pictures","Thunder Road","Moving Picture Company","Warner Bros. Pictures"],"production_companies":[{"name":"The Zanuck Company"},{"name":"Legendary Pictures"},{"name":"Thunder Road"},{"name":"Moving Picture Company"},{"name":"Warner Bros. Pictures"}],"cast":["Sam Worthington","Gemma Arterton","Mads Mikkelsen","Alexa Davalos","Jason Flemyng"],"backdrop_path":"https://image.tmdb.org/t/p/original/8nlIP8REpkLLW6vU2sX2Z5SRt7s.jpg","poster_path":"https://image.tmdb.org/t/p/original/R21t8SVfr6sQQ5mzjkecEU02YW.jpg","certification":"12","genres":["Aventura","Fantasia","Ação"],"trailer":"2Vxl3iHj4iI"},
"49047":{"id":"49047","name":"Gravidade","slug":"gravidade","original_title":"Gravity","overview":"Matt Kowalski é um astronauta experiente que está em missão de conserto ao telescópio Hubble juntamente com a doutora Ryan Stone. Ambos são surpreendidos por uma chuva de destroços decorrente da destruição de um satélite por um míssil russo, que faz com que sejam jogados no espaço sideral. Sem qualquer apoio da base terrestre da NASA, eles precisam encontrar um meio de sobreviver em meio a um ambiente completamente inóspito para a vida humana.","first_air_date":"2013-10-03","runtime":91,"episode_run_time":[91],"vote_average":7.2,"created_by":["Esperanto Filmoj","Warner Bros. Pictures","Heyday Films"],"production_companies":[{"name":"Esperanto Filmoj"},{"name":"Warner Bros. Pictures"},{"name":"Heyday Films"}],"cast":["Sandra Bullock","George Clooney","Ed Harris","Orto Ignatiussen","Phaldut Sharma"],"backdrop_path":"https://image.tmdb.org/t/p/original/npFPqZeHlEPOlLEpykP6kuSsi6v.jpg","poster_path":"https://image.tmdb.org/t/p/original/eHLufJ1bHy4PtEBJdPSTu4jIhZ0.jpg","certification":"N/A","genres":["Ficção científica","Thriller","Drama"],"trailer":"N/A"},
"235":{"id":"235","name":"Conta Comigo","slug":"conta-comigo","original_title":"Stand by Me","overview":"Em uma pequena cidade do Oregon, quatro amigos - o sensível Gordie, o durão Chris, o destemido Teddy e o acovardado Vern - resolvem sair à procura do cadáver de um adolescente desaparecido, que foi atropelado por um trem. O objetivo dos garotos é o de ser vistos como heróis diante dos amigos e dos moradores da cidade. Assim, eles partem numa inesquecível viagem de dois dias que se transforma em uma odisseia de autodescoberta e que evolui para um evento marcante em suas vidas.","first_air_date":"1986-08-08","runtime":89,"episode_run_time":[89],"vote_average":7.9,"created_by":["Columbia Pictures","Act III Productions"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Act III Productions"}],"cast":["Wil Wheaton","River Phoenix","Corey Feldman","Jerry O'Connell","Kiefer Sutherland"],"backdrop_path":"https://image.tmdb.org/t/p/original/yjGllQUm28R4X9xD9T5xMszirgw.jpg","poster_path":"https://image.tmdb.org/t/p/original/mRjlNNPo5wzQ67Ikg5ZWFwWF2jM.jpg","certification":"12","genres":["Crime","Drama"],"trailer":"N/A"},
