"8643":{"id":"8643","name":"O Exorcismo de Emily Rose","slug":"o-exorcismo-de-emily-rose","original_title":"The Exorcism of Emily Rose","overview":"A jovem estudante Emily Rose começa a alucinar e ter surtos cada vez mais frequentes, que causam perda de memória. Católica praticante, ela aceita ser submetida a uma sessão de exorcismo. Quem a realiza é o sacerdote de sua paróquia, o padre Richard Moore. Porém, Emily morre durante o exorcismo, o que faz com que o padre seja acusado de assassinato. A advogada Erin Bruner aceita pegar a defesa do padre e argumenta que a condição de Emily não pode ser explicada somente pela ciência.","first_air_date":"2005-09-09","runtime":121,"episode_run_time":[121],"vote_average":6.6,"created_by":["Lakeshore Entertainment","Firm Films","Screen Gems"],"production_companies":[{"name":"Lakeshore Entertainment"},{"name":"Firm Films"},{"name":"Screen Gems"}],"cast":["Laura Linney","Tom Wilkinson","Campbell Scott","Jennifer Carpenter","Kenneth Welsh"],"backdrop_path":"https://image.tmdb.org/t/p/original/aaj7lD92dWXc7pLROt782WrrT5M.jpg","poster_path":"https://image.tmdb.org/t/p/original/3tE6r2IaABY08EcIKF51qACri8H.jpg","certification":"14","genres":["Crime","Drama","Terror","Thriller"],"trailer":"N/A"},
