"11008":{"id":"11008","name":"Pelotão em Apuros","slug":"pelotao-em-apuros","original_title":"Major Payne","overview":"Major Benson Payne (Damon Wayans) foi um dos mais experientes oficiais da Marinha, mas agora que a guerra acabou, não há mais ninguém para combater. Prestes a ser dispensado do serviço, ele não sabe o que fazer como um civil. Então, seu oficial comandante lhe arranja um emprego como comandante da Academia Madison, para treinar novos recrutas. Só que não será fácil, já que ele não tem didática alguma e, além disso, no programa de treinamento Payne encontra adolescentes desajustados sem muita habilidade para o mundo militar.","first_air_date":"1995-03-24","runtime":97,"episode_run_time":[97],"vote_average":6.4,"created_by":["Universal Pictures","Wife 'n' Kids"],"production_companies":[{"name":"Universal Pictures"},{"name":"Wife 'n' Kids"}],"cast":["Damon Wayans","Karyn Parsons","William Hickey","Michael Ironside","Albert Hall"],"backdrop_path":"https://image.tmdb.org/t/p/original/4lNbhZcnrjG079TUkG1mIi2wen0.jpg","poster_path":"https://image.tmdb.org/t/p/original/uycZHrly1ICGjR2ESI3BSghMlAy.jpg","certification":"N/A","genres":["Aventura","Comédia","Família"],"trailer":"N/A"},
