"9426":{"id":"9426","name":"A Mosca","slug":"a-mosca","original_title":"The Fly","overview":"Seth Brundie (Jeff Goldblum) é um cientista excêntrico que trabalha numa nova invenção, uma máquina de teletransporte - a TelePod. Ao seu lado, tem Veronica (Geena Davis), uma jornalista que acompanha seus projetos acreditando ser essa a história do ano. Ao experimentar seu novo invento, Seth não percebe que uma mosca entrou na cabine do teletransporte. O imprevisto faz com que os padrões moleculares do homem e do inseto se misturem e, pouco a pouco, o cientista vai sofrendo terríveis transformações.","first_air_date":"1986-08-15","runtime":96,"episode_run_time":[96],"vote_average":7.4,"created_by":["SLM Production Group","Brooksfilms"],"production_companies":[{"name":"SLM Production Group"},{"name":"Brooksfilms"}],"cast":["Jeff Goldblum","Geena Davis","John Getz","Joy Boushel","Leslie Carlson"],"backdrop_path":"https://image.tmdb.org/t/p/original/2olgnm402FuL7kQHUQwyRSj0SmD.jpg","poster_path":"https://image.tmdb.org/t/p/original/iItA02bR1oBFlI7w5qi7AndVvmt.jpg","certification":"14","genres":["Terror","Ficção científica"],"trailer":"N/A"},
