"10661":{"id":"10661","name":"Zohan: Um Agente Bom de Corte","slug":"zohan-um-agente-bom-de-corte","original_title":"You Don't Mess with the Zohan","overview":"Zohan Dvir é um agente do alto comando militar de Israel que finge sua própria morte em um ataque de seu arquinimigo, o terrorista Fantasma, para realizar o sonho de sua vida: tornar-se cabeleireiro em Nova York. Ao chegar nos Estados Unidos sua 1ª parada é no salão de seu ídolo Paul Mitchell, onde assume a identidade de Scrappy Coco. Ridicularizado por seu jeito antiquado, Zohan não consegue o emprego sonhado. Ele busca então se adaptar à vida na nova cidade, até ser descoberto por seus antigos inimigos.","first_air_date":"2008-06-05","runtime":113,"episode_run_time":[113],"vote_average":5.7,"created_by":["Relativity Media","Happy Madison Productions","Columbia Pictures"],"production_companies":[{"name":"Relativity Media"},{"name":"Happy Madison Productions"},{"name":"Columbia Pictures"}],"cast":["Adam Sandler","Emmanuelle Chriqui","John Turturro","Nick Swardson","Lainie Kazan"],"backdrop_path":"https://image.tmdb.org/t/p/original/3xU4aJpI1y9wxLqBzePPqfcRQHN.jpg","poster_path":"https://image.tmdb.org/t/p/original/mT81xdLGdexnLfPqiNjjZ2BR82u.jpg","certification":"14","genres":["Comédia","Ação"],"trailer":"N/A"},
"481848":{"id":"481848","name":"O Chamado da Floresta","slug":"o-chamado-da-floresta","original_title":"The Call of the Wild","overview":"Depois de anos vivendo como um cachorro de estimação na casa de uma família na Califórnia, Buck precisa entrar em contato com os seus instintos mais selvagens para conseguir sobreviver em um ambiente hostil como o Alaska. Com o tempo, seu lado feroz se desenvolve e ele se torna o grande líder de sua matilha. Baseado no livro homônimo de Jack London, lançado em 1903.","first_air_date":"2020-02-19","runtime":100,"episode_run_time":[100],"vote_average":7.5,"created_by":["3 Arts Entertainment","20th Century Studios","TSG Entertainment","Halon Entertainment"],"production_companies":[{"name":"3 Arts Entertainment"},{"name":"20th Century Studios"},{"name":"TSG Entertainment"},{"name":"Halon Entertainment"}],"cast":["Harrison Ford","Dan Stevens","Colin Woodell","Karen Gillan","Omar Sy"],"backdrop_path":"https://image.tmdb.org/t/p/original/1GZCV0dwIoAn6jpWPfVAbeMTVC2.jpg","poster_path":"https://image.tmdb.org/t/p/original/1SIlV2p8355FAuKTGje9ZgtXujN.jpg","certification":"12","genres":["Aventura","Família","Drama"],"trailer":"N/A"},
"76726":{"id":"76726","name":"Poder Sem Limites","slug":"poder-sem-limites","original_title":"Chronicle","overview":"Após ingerir uma substância misteriosa, três amigos são surpreendidos ao ganhar superpoderes. De início eles os usam para brincar com conhecidos, mas aos poucos ganham a sensação de impunidade e passam a realizar feitos maiores. Sentindo-se invulneráveis, eles ultrapassam qualquer limite quando uma pessoa é morta.","first_air_date":"2012-02-01","runtime":84,"episode_run_time":[84],"vote_average":6.8,"created_by":["Dune Entertainment","Davis Entertainment","Adam Schroeder Productions","20th Century Fox"],"production_companies":[{"name":"Dune Entertainment"},{"name":"Davis Entertainment"},{"name":"Adam Schroeder Productions"},{"name":"20th Century Fox"}],"cast":["Dane DeHaan","Alex Russell","Michael B. Jordan","Michael Kelly","Ashley Grace"],"backdrop_path":"https://image.tmdb.org/t/p/original/rgNzvSagnlc32TuMEBa529QFIig.jpg","poster_path":"https://image.tmdb.org/t/p/original/6B5RG12qgv8ckIdVoKGuhE4zkrW.jpg","certification":"14","genres":["Ficção científica","Drama","Thriller"],"trailer":"N/A"},
"11683":{"id":"11683","name":"Terra dos Mortos","slug":"terra-dos-mortos","original_title":"Land of the Dead","overview":"O futuro tornou-se um pesadelo onde a sociedade de consumo chegou a um extremo. Um líder mercenário vai ter que enfrentar um rebelde, enquanto zumbis dominam a cidade, que está cercada por uma muralha que separa os pobres dos ricos.","first_air_date":"2005-06-18","runtime":93,"episode_run_time":[93],"vote_average":6.2,"created_by":["Romero-Grunwald Productions","Universal Pictures","Atmosphere Entertainment MM","Wild Bunch","Rangerkim","Ontario Media Development Corporation"],"production_companies":[{"name":"Romero-Grunwald Productions"},{"name":"Universal Pictures"},{"name":"Atmosphere Entertainment MM"},{"name":"Wild Bunch"},{"name":"Rangerkim"},{"name":"Ontario Media Development Corporation"}],"cast":["Simon Baker","John Leguizamo","Dennis Hopper","Asia Argento","Robert Joy"],"backdrop_path":"https://image.tmdb.org/t/p/original/oOZtWMhJft0QvPcnJXFgGlt0Jn7.jpg","poster_path":"https://image.tmdb.org/t/p/original/1dJ9BmOntBskuBbCnTuDmCVEf0i.jpg","certification":"N/A","genres":["Terror","Ficção científica","Thriller"],"trailer":"N/A"},
"264660":{"id":"264660","name":"Ex_Machina: Instinto Artificial","slug":"ex-machina-instinto-artificial","original_title":"Ex Machina","overview":"Um jovem programador chamado Caleb ganha um concurso e recebe a oportunidade de testar uma inteligência artificial criada por Nathan, um brilhante e recluso bilionário. Mas conforme os testes progridem, Caleb descobre que essa inteligência artificial é tão sofisticada e imprevisível que ele não sabe mais em quem confiar.","first_air_date":"2014-12-16","runtime":108,"episode_run_time":[108],"vote_average":7.6,"created_by":["DNA Films","Film4 Productions","IAC Films","Scott Rudin Productions"],"production_companies":[{"name":"DNA Films"},{"name":"Film4 Productions"},{"name":"IAC Films"},{"name":"Scott Rudin Productions"}],"cast":["Domhnall Gleeson","Alicia Vikander","Oscar Isaac","Sonoya Mizuno","Corey Johnson"],"backdrop_path":"https://image.tmdb.org/t/p/original/jFxxqdEQ9TkXQSytO7qM8wlwXL1.jpg","poster_path":"https://image.tmdb.org/t/p/original/hfpnFtgcYom9Gk9s1IyWiovpZYg.jpg","certification":"16","genres":["Drama","Ficção científica"],"trailer":"N/A"},
"15":{"id":"15","name":"Cidadão Kane","slug":"cidadao-kane","original_title":"Citizen Kane","overview":"Charles Foster Kane foi um menino pobre que acaba se tornando um dos homens mais ricos do mundo. O filme inicia com a sua morte, momentos antes da qual pronuncia a palavra \"Rosebud\". Após dias de sensacionalismo em cima da notícia de sua morte, o jornalista Jerry Thompson é enviado por seu chefe para investigar a vida de Kane, a fim de descobrir o sentido de sua última palavra, a qual ninguém sabia. Entrevistando pessoas do passado de Kane, o jornalista mergulha na vida de um homem solitário, que desde a infância é obrigado a seguir a vontade alheia. Ninguém a seu redor importa-se com Kane, que busca por meio da aquisição de bens a adoração das pessoas. Ao final, Thompson, após a exaustiva investigação da vida de Kane através de entrevistas, se vê incapaz de descobrir o significado da palavra, concluindo que \"Charles Foster Kane foi um homem que possuiu tudo o que quis e depois perdeu tudo. Talvez Rosebud seja algo que ele nunca tenha possuído ou algo que tenha perdido\".","first_air_date":"1941-04-17","runtime":119,"episode_run_time":[119],"vote_average":8.0,"created_by":["Mercury Productions","RKO Radio Pictures"],"production_companies":[{"name":"Mercury Productions"},{"name":"RKO Radio Pictures"}],"cast":["Orson Welles","Joseph Cotten","Dorothy Comingore","Ray Collins","George Coulouris"],"backdrop_path":"https://image.tmdb.org/t/p/original/ruF3Lmd4A8MHbnEBE6lxPMbsHGL.jpg","poster_path":"https://image.tmdb.org/t/p/original/7RdvqkBX2gi6kiZ2yySeRqeClur.jpg","certification":"12","genres":["Mistério","Drama"],"trailer":"N/A"},
