"455476":{"id":"455476","name":"Os Cavaleiros do Zodíaco - Saint Seiya: O Começo","slug":"os-cavaleiros-do-zodiaco-saint-seiya-o-comeco","original_title":"Knights of the Zodiac","overview":"Quando um órfão de rua teimoso em busca de sua irmã sequestrada involuntariamente toca em poderes ocultos, ele descobre que pode ser a única pessoa viva que pode proteger uma deusa reencarnada, enviada para vigiar a humanidade. Ele só se tornará um Cavaleiro do Zodíaco quando puder deixar sua irmã ir e abraçar seu destino.","first_air_date":"2023-04-27","runtime":113,"episode_run_time":[113],"vote_average":6.4,"created_by":["Stage 6 Films","Toei Animation"],"production_companies":[{"name":"Stage 6 Films"},{"name":"Toei Animation"}],"cast":["新田真剣佑","Madison Iseman","Diego Tinoco","Mark Dacascos","Nick Stahl"],"backdrop_path":"https://image.tmdb.org/t/p/original/fLEsa5SKTFgrdUGMHbsWomniak6.jpg","poster_path":"https://image.tmdb.org/t/p/original/1qos0X6EIi4KT9RmJiVGZB9Kw6l.jpg","certification":"12","genres":["Fantasia","Ação","Aventura"],"trailer":"cHmHFp48p7U"},
"10637":{"id":"10637","name":"Duelo de Titãs","slug":"duelo-de-titas","original_title":"Remember the Titans","overview":"Herman Boone (Denzel Washington) um técnico de futebol americano contratado para trabalhar no comando de um time universitário dividido pelo racismo, os Titans. Inicialmente, Boone sofre preconceitos raciais por parte dos demais técnicos e até mesmo de jogadores do seu time, mas aos poucos ele conquista o respeito de todos e torna-se um grande exemplo para o time e também para a pequena cidade em que vive.","first_air_date":"2000-09-29","runtime":113,"episode_run_time":[113],"vote_average":7.6,"created_by":["Jerry Bruckheimer Films","Run It Up Productions Inc.","Technical Black","Walt Disney Pictures"],"production_companies":[{"name":"Jerry Bruckheimer Films"},{"name":"Run It Up Productions Inc."},{"name":"Technical Black"},{"name":"Walt Disney Pictures"}],"cast":["Denzel Washington","Will Patton","Wood Harris","Ryan Hurst","Donald Faison"],"backdrop_path":"https://image.tmdb.org/t/p/original/cMUReq46MSz6WWsdW1Gu8oecJlc.jpg","poster_path":"https://image.tmdb.org/t/p/original/kuKyp6Owly8yWXeqdi4H8NAXhU6.jpg","certification":"L","genres":["Drama"],"trailer":"N/A"},
"10323":{"id":"10323","name":"Fúria de Titãs","slug":"furia-de-titas","original_title":"Clash of the Titans","overview":"Deuses do Olimpo, terríveis monstros mitológicos e heróis mortais fazem deste espetáculo de imaginação uma aventura imperdível. Harry Hamlin é Perseu, o filho mortal de Zeus (Laurence Olivier), que luta para salvar a vida da princesa Andrômeda (Judi Bowker) do monstro marinho Kraken. Para tal, ele precisa de uma arma tão letal quanto difícil de conseguir: A cabeça de Medusa! Acompanhado de um grupo de corajosos guerreiros e montado no fabuloso Pegasus, o cavalo alado, Perseu parte em uma aventura sem precedentes pelas terras fantásticas da mitologia grega.","first_air_date":"1981-06-12","runtime":118,"episode_run_time":[118],"vote_average":6.9,"created_by":["Peerford Ltd.","Metro-Goldwyn-Mayer","Charles H. Schneer Productions","Titan Productions"],"production_companies":[{"name":"Peerford Ltd."},{"name":"Metro-Goldwyn-Mayer"},{"name":"Charles H. Schneer Productions"},{"name":"Titan Productions"}],"cast":["Harry Hamlin","Judi Bowker","Burgess Meredith","Maggie Smith","Ursula Andress"],"backdrop_path":"https://image.tmdb.org/t/p/original/ozo1BNadCZ2w0rRf1e4ioOnIEqf.jpg","poster_path":"https://image.tmdb.org/t/p/original/5LObtR57MxWD7Me0tiRaqgrqKQD.jpg","certification":"14","genres":["Aventura","Fantasia"],"trailer":"N/A"},
"1656":{"id":"1656","name":"A Lenda do Zorro","slug":"a-lenda-do-zorro","original_title":"The Legend of Zorro","overview":"Tendo passado os últimos dez anos lutando contra a injustiça e a crueldade, Alejandro de la Vega está agora enfrentando o seu maior desafio: o amor de sua vida, Elena, lhe expulsou de casa! Elena entrou com pedido de divórcio e encontrou consolo nos braços do Conde Armand, um encantador aristocrata francês. Mas Alejandro sabe de algo que ela não sabe: Armand é a mente maligna por trás do plano terrorista de destruir os Estados Unidos. E assim, com seu casamento e o futuro do seu país em risco, é a vez de Zorro tentar salvar duas uniões antes que seja tarde demais.","first_air_date":"2005-10-24","runtime":130,"episode_run_time":[130],"vote_average":6.1,"created_by":["Columbia Pictures","Spyglass Entertainment","Amblin Entertainment"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Spyglass Entertainment"},{"name":"Amblin Entertainment"}],"cast":["Antonio Banderas","Catherine Zeta-Jones","Adrian Alonso","Julio Oscar Mechoso","Nick Chinlund"],"backdrop_path":"https://image.tmdb.org/t/p/original/2b3PSB97qrxQduzquYihf7u3uwV.jpg","poster_path":"https://image.tmdb.org/t/p/original/gytF1nr4DgM07W36MittxLl15LX.jpg","certification":"12","genres":["Ação","Aventura","Faroeste"],"trailer":"N/A"},
