"295830":{"id":"295830","name":"Ataque dos Titãs","slug":"ataque-dos-titas","original_title":"進撃の巨人 ATTACK ON TITAN","overview":"Japão, dias atuais. A chegada repentina dos Titãs - misteriosas criaturas humanoides gigantes que devoram seres humanos um após o outro - leva a humanidade à beira da extinção. Cem anos depois, o que resta da população humana vive agora em relativa paz por trás de enormes muralhas erguidas para defendê-los dos Titãs. Contudo, novamente, esta paz é destruída quando um Titã Colossal, medindo mais de 50 metros de altura, atravessa uma das muralhas, permitindo que uma horda de outros Titãs entre. Eren Yeager resignou-se a uma vida confinado dentro dessas muralhas. “Nada que eu fizer vai fazer diferença”, ele pensava. Mas quando ele se junta à Equipe de Restauração da Muralha Externa, convocada para lutar contra os Titãs, ele se reúne com Mikasa, uma amiga de infância e alguém que há muito tempo ele se arrepende de não ter podido salvar.","first_air_date":"2015-08-01","runtime":98,"episode_run_time":[98],"vote_average":6.1,"created_by":["Nikkatsu Corporation","TOHO","Kodansha","dentsu","AMUSE","Horipro","Hakuhodo DY Media Partners","jeki","KDDI","Yomiuri Shimbun Company","Nippan Group Holdings","GYAO","Tokyo FM","The Asahi Shimbun"],"production_companies":[{"name":"Nikkatsu Corporation"},{"name":"TOHO"},{"name":"Kodansha"},{"name":"dentsu"},{"name":"AMUSE"},{"name":"Horipro"},{"name":"Hakuhodo DY Media Partners"},{"name":"jeki"},{"name":"KDDI"},{"name":"Yomiuri Shimbun Company"},{"name":"Nippan Group Holdings"},{"name":"GYAO"},{"name":"Tokyo FM"},{"name":"The Asahi Shimbun"}],"cast":["三浦春馬","水原希子","本郷奏多","桜庭ななみ","三浦貴大"],"backdrop_path":"https://image.tmdb.org/t/p/original/qRik98bxXPn4qCHTe3ffhbGFRAu.jpg","poster_path":"https://image.tmdb.org/t/p/original/hQdsjMnSjB5IY1uMViG8B6HdiKn.jpg","certification":"N/A","genres":["Terror","Ação","Ficção científica"],"trailer":"N/A"},
