"9387":{"id":"9387","name":"Conan, o Bárbaro","slug":"conan-o-barbaro","original_title":"Conan the Barbarian","overview":"Há milhares de anos, Thulsa Doom, um demoníaco feiticeiro, comanda um ataque em uma aldeia por motivos até hoje não revelados, que poderia ser simplesmente pelo prazer de matar ou para descobrir o segredo do aço, que era guardado pelos moradores desta aldeia. Conan, um cimério, vê seus pais serem mortos na sua frente e seu povo ser massacrado, sendo que ele, ainda criança, é levado para um campo de escravos. Os anos passam e ele desenvolve uma enorme força física, o que faz Conan se tornar gladiador. Ele ainda se mantém determinado a vingar a morte dos pais e quando é libertado tenta alcançar seu objetivo. Conan descobre que Thulsa Doom lidera o misterioso Culto da Serpente e, tentando se aproximar do feiticeiro, faz amizade com dois ladrões, Valéria e Subotai. Ao trio é prometida uma vultosa recompensa pelo rei Osric, que quer que o trio de guerreiros resgate sua filha, que se tornou uma seguidora de Thulsa Doom.","first_air_date":"1982-04-02","runtime":129,"episode_run_time":[129],"vote_average":6.8,"created_by":["Universal Pictures","The De Laurentiis Company","Pressman Film","Estudios Churubusco Azteca"],"production_companies":[{"name":"Universal Pictures"},{"name":"The De Laurentiis Company"},{"name":"Pressman Film"},{"name":"Estudios Churubusco Azteca"}],"cast":["Arnold Schwarzenegger","James Earl Jones","Max von Sydow","Sandahl Bergman","Ben Davidson"],"backdrop_path":"https://image.tmdb.org/t/p/original/fNp2ikvY8WZTyVbK1iXW84RLbO5.jpg","poster_path":"https://image.tmdb.org/t/p/original/jJ9nPXPmnIFhmrzDSRpyXLYQL7w.jpg","certification":"16","genres":["Aventura","Fantasia","Ação"],"trailer":"N/A"},
