"691":{"id":"691","name":"007 O Espião Que Me Amava","slug":"007-o-espiao-que-me-amava","original_title":"The Spy Who Loved Me","overview":"A Inglaterra descobre que alguém sabe como rastrear um submarino submerso e está oferecendo esta tecnologia para quem pagar mais alto. Uma crise internacional tem início quando um submarino com dezesseis mísseis nucleares desaparece, enquanto fazia uma patrulha. O agente secreto 007 (Roger Moore) é incumbido de investigar o caso e recuperar as ogivas antes que sejam disparadas e, para isto, recebe a ajuda de uma bela e sensual agente soviética (Barbara Bach).","first_air_date":"1977-07-07","runtime":125,"episode_run_time":[125],"vote_average":6.8,"created_by":["EON Productions","United Artists"],"production_companies":[{"name":"EON Productions"},{"name":"United Artists"}],"cast":["Roger Moore","Barbara Bach","Curd Jürgens","Richard Kiel","Caroline Munro"],"backdrop_path":"https://image.tmdb.org/t/p/original/xButHM6FwbA6tiWCD68BMpVqaHY.jpg","poster_path":"https://image.tmdb.org/t/p/original/l7qtdY0f2q14U41wb7Y755RCCEx.jpg","certification":"12","genres":["Aventura","Ação","Thriller"],"trailer":"N/A"},
"52449":{"id":"52449","name":"Professora Sem Classe","slug":"professora-sem-classe","original_title":"Bad Teacher","overview":"Para a maioria, o ensino é uma profissão honrosa, exceto para Elizabeth. A desbocada e embriagada professora mal pode esperar para se casar com um homem rico e largar o emprego, mas assim que seu namorado a deixa, ela precisa repensar sobre seus planos. Quando Scott Delacorte, um professor substituto bonito e rico chega à escola, Elizabeth encontra nele uma saída para sua situação, mas terá de enfrentar a forte concorrência de Amy, uma colega popular e alegre.","first_air_date":"2011-05-16","runtime":92,"episode_run_time":[92],"vote_average":5.6,"created_by":["Columbia Pictures","Mosaic Media Group"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Mosaic Media Group"}],"cast":["Cameron Diaz","Jason Segel","Justin Timberlake","Lucy Punch","John Michael Higgins"],"backdrop_path":"https://image.tmdb.org/t/p/original/ki6xo54bV6dGLROmAbdftTvxl1p.jpg","poster_path":"https://image.tmdb.org/t/p/original/2lwjgWQhLNHuJQ3wgHhYV7luSoa.jpg","certification":"14","genres":["Comédia"],"trailer":"N/A"},
"49529":{"id":"49529","name":"John Carter: Entre Dois Mundos","slug":"john-carter-entre-dois-mundos","original_title":"John Carter","overview":"O soldado americano John Carter, para a tristeza de seus parentes, faleceu no planeta Terra. Contudo, para a alegria de outros, ressuscitou em Marte. Agora, em meio a uma guerra civil no planeta vermelho, habitado por seres de cor verde e criaturas gigantescas, ele é visto como a única esperança de ajudar a princesa Deja Thoris, a salvar o seu mundo, numa batalha que mudará para sempre o seu destino.","first_air_date":"2012-03-07","runtime":132,"episode_run_time":[132],"vote_average":6.3,"created_by":["Walt Disney Pictures"],"production_companies":[{"name":"Walt Disney Pictures"}],"cast":["Taylor Kitsch","Lynn Collins","Samantha Morton","Mark Strong","Ciarán Hinds"],"backdrop_path":"https://image.tmdb.org/t/p/original/ubNevniKd5NYo60DqYIQ29T0uyB.jpg","poster_path":"https://image.tmdb.org/t/p/original/uv6RHSX6cvlCOUDgqcscxChyofj.jpg","certification":"12","genres":["Ação","Aventura","Ficção científica"],"trailer":"N/A"},
