"259018":{"id":"259018","name":"Tudo para Ficar com Ela","slug":"tudo-para-ficar-com-ela","original_title":"Behaving Badly","overview":"Aos 18 anos de idade, Rick Stevens ainda é virgem, mas pretende mudar essa situação com a garota por quem está apaixonado: Nina Pennington. No entanto, antes de conquistar o coração da garota, ele deve lidar com um grupo nada convencional de adultos que o cercam, incluindo a sedutora mãe de um amigo, sua mãe alcoólatra e o reitor da escola, um pervertido sexual.","first_air_date":"2014-04-14","runtime":92,"episode_run_time":[92],"vote_average":5.3,"created_by":["Starboard Entertainment","Mad Chance","Voltage Pictures"],"production_companies":[{"name":"Starboard Entertainment"},{"name":"Mad Chance"},{"name":"Voltage Pictures"}],"cast":["Nat Wolff","Selena Gomez","Mary-Louise Parker","Elisabeth Shue","Dylan McDermott"],"backdrop_path":"https://image.tmdb.org/t/p/original/odjVFoEy7Qyko2qooWDbT5OuLUx.jpg","poster_path":"https://image.tmdb.org/t/p/original/kaXUWb80NGy4lLSQ879moKwsjcU.jpg","certification":"16","genres":["Comédia"],"trailer":"N/A"},
