"595":{"id":"595","name":"O Sol é Para Todos","slug":"o-sol-e-para-todos","original_title":"To Kill a Mockingbird","overview":"Scout Finch, de 6 anos, e seu irmão mais velho, Jem, vivem na pacata Maycomb, Alabama, passando a maior parte do tempo com seu amigo Dill e espionando seu vizinho recluso e misterioso, Boo Radley. Quando Atticus, seu pai viúvo e um advogado respeitado, defende um homem negro chamado Tom Robinson contra acusações forjadas de estupro, o julgamento e os eventos seguintes expõem as crianças aos males do racismo e dos estereótipos.","first_air_date":"1962-12-20","runtime":130,"episode_run_time":[130],"vote_average":8.0,"created_by":["Pakula-Mulligan","Brentwood Productions"],"production_companies":[{"name":"Pakula-Mulligan"},{"name":"Brentwood Productions"}],"cast":["Mary Badham","Gregory Peck","Phillip Alford","John Megna","Frank Overton"],"backdrop_path":"https://image.tmdb.org/t/p/original/wEv8HdcCKaimjkUdZ8ytsLjCzPn.jpg","poster_path":"https://image.tmdb.org/t/p/original/qIsxcjmJW7ykIHJDuB2NqJUChIZ.jpg","certification":"12","genres":["Drama"],"trailer":"N/A"},
"13475":{"id":"13475","name":"Star Trek","slug":"star-trek","original_title":"Star Trek","overview":"Está tudo pronto para a viagem inaugural da nave espacial mais moderna já criada: a USS Enterprise. Sua jovem tripulação tem uma missão importante: encontrar uma maneira de deter o malvado Nero que, motivado pela vingança, ameaça toda a humanidade. Mas o destino da galáxia está nas mãos de dois jovens rivais, que nasceram em mundos diferentes. Um deles, Tiberius James Kirk, é humano, em busca de emoções e um líder nato. O outro, Spock, meio humano e meio vulcano, é desprezado pelos vulcanos por suas emoções humanas.","first_air_date":"2009-05-06","runtime":127,"episode_run_time":[127],"vote_average":7.4,"created_by":["Paramount Pictures","Spyglass Entertainment","Bad Robot"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Spyglass Entertainment"},{"name":"Bad Robot"}],"cast":["Chris Pine","Zachary Quinto","Leonard Nimoy","Eric Bana","Bruce Greenwood"],"backdrop_path":"https://image.tmdb.org/t/p/original/zzzoRNVSaUv6e1hpADjUDeM3EvY.jpg","poster_path":"https://image.tmdb.org/t/p/original/qZ9VC2XGEqdPWOO8yA5BSBU5vDd.jpg","certification":"12","genres":["Ficção científica","Ação","Aventura"],"trailer":"N/A"},
"594":{"id":"594","name":"O Terminal","slug":"o-terminal","original_title":"The Terminal","overview":"Viktor Navorski é um cidadão da Europa Oriental que viaja rumo a Nova York justamente quando seu país sofre um golpe de estado, o que faz com que seu passaporte seja invalidado. Ao chegar ao aeroporto, Viktor não consegue autorização para entrar nos Estados Unidos. Sem poder retornar à sua terra natal, já que as fronteiras foram fechadas após o golpe, Viktor passa a improvisar seus dias e noites no próprio aeroporto, à espera que a situação se resolva. Porém, com a situação se arrastando por meses, Viktor permanece no aeroporto e passa a descobrir o complexo mundo do terminal onde está preso.","first_air_date":"2004-06-17","runtime":129,"episode_run_time":[129],"vote_average":7.3,"created_by":["DreamWorks Pictures","Amblin Entertainment","Parkes/MacDonald Productions"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"Amblin Entertainment"},{"name":"Parkes/MacDonald Productions"}],"cast":["Tom Hanks","Catherine Zeta-Jones","Stanley Tucci","Chi McBride","Diego Luna"],"backdrop_path":"https://image.tmdb.org/t/p/original/dfGJKPaxabWaXacJ2fw6zXgA9QX.jpg","poster_path":"https://image.tmdb.org/t/p/original/79KN5lZ286El2GDjIomyN29jx80.jpg","certification":"12","genres":["Comédia","Drama"],"trailer":"N/A"},
"1701":{"id":"1701","name":"Con Air: A Rota da Fuga","slug":"con-air-a-rota-da-fuga","original_title":"Con Air","overview":"Cameron Poe conquistou a liberdade condicional e pega carona em um voo que transporta diversos criminosos do país, entre eles, o psicopata Cyrus. Mas o que era para ser apenas uma viagem torna-se um grande pesadelo, porque os bandidos assumem o controle do avião para sair do país e dão início a um insano plano de fuga. Agora, Poe terá que fingir que está de acordo com eles para se manter vivo e depois tentar reverter a situação.","first_air_date":"1997-06-05","runtime":116,"episode_run_time":[116],"vote_average":6.7,"created_by":["Touchstone Pictures","Jerry Bruckheimer Films"],"production_companies":[{"name":"Touchstone Pictures"},{"name":"Jerry Bruckheimer Films"}],"cast":["Nicolas Cage","John Cusack","John Malkovich","Ving Rhames","Mykelti Williamson"],"backdrop_path":"https://image.tmdb.org/t/p/original/vsmlShNNHrYlERZaqMOsZ3YctoO.jpg","poster_path":"https://image.tmdb.org/t/p/original/wlY0uq0EkxqBhjUQK50VEylGtSM.jpg","certification":"N/A","genres":["Ação","Thriller","Crime"],"trailer":"N/A"},
