"38050":{"id":"38050","name":"Os Agentes do Destino","slug":"os-agentes-do-destino","original_title":"The Adjustment Bureau","overview":"David Norris é um jovem político com uma carreira promissora, mas um escândalo atrapalhou a sua corrida ao Senado. Tão logo perde a disputa pela vaga ele conhece Elise, bailarina por quem se apaixona. Contudo, homens com estranhos poderes de interferir no futuro aparecem do nada e começam a pressioná-lo para que ele não dê continuidade a este romance, porque isso poderá atrapalhar o futuro de ambos. Sem saber ao certo quem são essas pessoas, a única certeza que David possui é que precisará reunir forças para enfrentá-los e encarar o que o destino lhe reserva.","first_air_date":"2011-03-03","runtime":106,"episode_run_time":[106],"vote_average":6.8,"created_by":["Universal Pictures","MRC","Gambit Pictures"],"production_companies":[{"name":"Universal Pictures"},{"name":"MRC"},{"name":"Gambit Pictures"}],"cast":["Matt Damon","Emily Blunt","John Slattery","Anthony Mackie","Michael Kelly"],"backdrop_path":"https://image.tmdb.org/t/p/original/yPAYpLofITQ9pST80ZNBGIE2pfN.jpg","poster_path":"https://image.tmdb.org/t/p/original/cvepcobwgtLwCplwBihcvlgqd0A.jpg","certification":"12","genres":["Ficção científica","Thriller","Romance"],"trailer":"MS5b_SY8Mko"},
"843380":{"id":"843380","name":"Caçadores de Recompensas","slug":"cacadores-de-recompensas","original_title":"Dead for a Dollar","overview":"O veterano caçador de recompensas Max Borlund (Christoph Waltz) está no interior do México, onde encontra o jogador de cartas profissional e bandido Joe Cribbens (Willem Dafoe) – um inimigo jurado que ele mandou para a prisão anos antes. Max está em uma missão para encontrar e resgatar Rachel Kidd (Rachel Brosnahan), a esposa de um rico empresário que, como a história é contada a Max, foi sequestrada pelo Soldado de Buffalo, Elijah Jones (Brandon Scott). No final, Max enfrenta um confronto para salvar a honra.","first_air_date":"2022-09-30","runtime":106,"episode_run_time":[106],"vote_average":5.9,"created_by":["Chaos, a Film Company","Polaris Pictures"],"production_companies":[{"name":"Chaos, a Film Company"},{"name":"Polaris Pictures"}],"cast":["Christoph Waltz","Willem Dafoe","Rachel Brosnahan","Hamish Linklater","Benjamin Bratt"],"backdrop_path":"https://image.tmdb.org/t/p/original/15BnuDQ8pYRmLqPZKAk5vIhUu9J.jpg","poster_path":"https://image.tmdb.org/t/p/original/Ad3JHINn6GYUR2UkadJTHvaK71q.jpg","certification":"N/A","genres":["Faroeste","Thriller","Ação","Drama"],"trailer":"N/A"},
"11954":{"id":"11954","name":"Força Sinistra","slug":"forca-sinistra","original_title":"Lifeforce","overview":"Tudo começa quando a tripulação de um ônibus espacial descobre, na cauda do cometa, uma espaçonave contendo alienígenas fossilizados, a maior parte semelhantes a grandes morcegos. Três dos alienígenas, em forma humana, são trazidos à Terra, revivem e, ao se alimentarem da força vital de suas vítimas, transformam as pessoas em um tipo de vampiro. As vítimas continuam o ciclo, e em breve todo o planeta está em perigo. O único sobrevivente do ônibus espacial segue em busca da líder dos vampiros do espaço.","first_air_date":"1985-06-21","runtime":116,"episode_run_time":[116],"vote_average":6.3,"created_by":["Golan-Globus Productions","Easedram","London-Cannon Films","The Cannon Group"],"production_companies":[{"name":"Golan-Globus Productions"},{"name":"Easedram"},{"name":"London-Cannon Films"},{"name":"The Cannon Group"}],"cast":["Steve Railsback","Peter Firth","Frank Finlay","Mathilda May","Patrick Stewart"],"backdrop_path":"https://image.tmdb.org/t/p/original/8SnnGg0cqfa3bmorOERNrXvZ8Mn.jpg","poster_path":"https://image.tmdb.org/t/p/original/9q8xozOeYx9qcwjYYXtSiNIXtua.jpg","certification":"N/A","genres":["Terror","Ficção científica"],"trailer":"N/A"},
