"179826":{"id":"179826","name":"O Estranho Thomas","slug":"o-estranho-thomas","original_title":"Odd Thomas","overview":"Baseado no best-seller de Dean Koontz, o filme conta a história de Thomas (Anton Yelchin), um rapaz de 20 anos que possui poderes clarividentes e trabalha num fast-food de uma pequena cidade do deserto californiano. Logo após um sonho premonitório, ele vê entrar em seu restaurante um homem misterioso que parece ter alguma ligação com forças obscuras e ameaçadoras. Sua tarefa agora é descobrir o significado deste encontro que, para ele, não prediz coisas boas.","first_air_date":"2013-01-29","runtime":96,"episode_run_time":[96],"vote_average":6.9,"created_by":["Future Films","Fusion Films","The Sommers Company"],"production_companies":[{"name":"Future Films"},{"name":"Fusion Films"},{"name":"The Sommers Company"}],"cast":["Anton Yelchin","Addison Timlin","Willem Dafoe","Gugu Mbatha-Raw","Nico Tortorella"],"backdrop_path":"https://image.tmdb.org/t/p/original/iiYP6CZr2EzR8vYCbmXs3801GNx.jpg","poster_path":"https://image.tmdb.org/t/p/original/9AjBJMDVYVI97i0JN3Opkj9Eskj.jpg","certification":"14","genres":["Mistério","Thriller"],"trailer":"N/A"},
