"90":{"id":"90","name":"Um Tira da Pesada","slug":"um-tira-da-pesada","original_title":"Beverly Hills Cop","overview":"Poucas horas depois de chegar em Detroit, Mikey Tandino foi morto. Axel Foley, policial e seu melhor amigo, viaja para Los Angeles, pois tinha sido o último lugar onde Mikey trabalhou. O emprego de Mikey tinha sido conseguido por Jenny Summers, amiga de ambos, que administra uma famosa galeria de arte em Beverly Hills. Porém, Foley tem de fazer tudo informalmente, pois está fora do caso e pretende seguir a pista do possível mandante do crime, Victor Maitland, o chefe de Jenny e dono da galeria. Apesar de Maitland ser considerado um dos maiores marchands do país, Axel acredita que ele usa o mercado de arte como fachada e consegue que dois relutantes policiais locais, Billy Rosewood e John Taggart, se unam a ele nas investigações.","first_air_date":"1984-12-05","runtime":105,"episode_run_time":[105],"vote_average":7.2,"created_by":["Paramount Pictures","Eddie Murphy Productions","Don Simpson/Jerry Bruckheimer Films"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Eddie Murphy Productions"},{"name":"Don Simpson/Jerry Bruckheimer Films"}],"cast":["Eddie Murphy","Judge Reinhold","John Ashton","Lisa Eilbacher","Ronny Cox"],"backdrop_path":"https://image.tmdb.org/t/p/original/p256RduW9wMC3uhGJTerywmGiiX.jpg","poster_path":"https://image.tmdb.org/t/p/original/wjcOukmiJKp4oMrIXOa3hlvODph.jpg","certification":"12","genres":["Comédia","Crime","Ação"],"trailer":"N/A"},
