"6466":{"id":"6466","name":"Freddy x Jason","slug":"freddy-x-jason","original_title":"Freddy vs. Jason","overview":"Imagine que você está tendo um pesadelo tão real e angustiante que a morte seria um alívio... É assim que os jovens de Elm Street e Crystal Lake sentem-se desde que Freddy Krueger ressuscitou Jason Vorhees. Um medo que tudo assusta, um nervosismo que faz rir. Na rua Elm, tudo está tranquilo. As vítimas potenciais de Freddy, há mais de 10 anos foram isoladas e inibidas de sonhar através do uso de drogas. Assim, a lembrança do maníaco está se apagando e enfraquecendo-o cada vez mais. Desesperado, Freddy decide utilizar-se de outro demônio para reacender sua apavorante memória entre os vivos. Surge então entre os dois uma crescente tensão cujo ápice será um verdadeiro Duelo de Titãs!","first_air_date":"2003-08-15","runtime":98,"episode_run_time":[98],"vote_average":6.1,"created_by":["Yannix Technology Corporation","New Line Cinema","Avery Pix","Crystal Lake Entertainment","WTC Productions","Sean S. Cunningham Films"],"production_companies":[{"name":"Yannix Technology Corporation"},{"name":"New Line Cinema"},{"name":"Avery Pix"},{"name":"Crystal Lake Entertainment"},{"name":"WTC Productions"},{"name":"Sean S. Cunningham Films"}],"cast":["Robert Englund","Ken Kirzinger","Monica Keena","Jason Ritter","Kelly Rowland"],"backdrop_path":"https://image.tmdb.org/t/p/original/2d6Ms1gdvFKZJBvpGUWxmmQcfEd.jpg","poster_path":"https://image.tmdb.org/t/p/original/972S6KEN4qG1UzvcDHHFj8Q9iUj.jpg","certification":"16","genres":["Terror"],"trailer":"N/A"},
