"13888":{"id":"13888","name":"De Volta à Lagoa Azul","slug":"de-volta-a-lagoa-azul","original_title":"Return to the Blue Lagoon","overview":"Em virtude da cólera, Sarah, uma viúva, é deixada em um barco com um marinheiro e dois bebês: Lilli, sua filha, e Richard, filho de Emmeline, que tinha sido resgatado há poucos dias de um barco à deriva, onde seus pais foram encontrados mortos. Depois de vários dias o marinheiro pensa em matar os bebês para economizar água, mas Sarah não aceita tal atitude e mata o marujo. Depois de muitos dias ela chega com os bebês em uma bela ilha. Ela educa as crianças e quando elas têm quase 8 anos, ela morre. Quando Lilli e Richard se tornam jovens, se apaixonam e se \"casam\". Quando um navio chega na ilha alguns problemas acontecem, mas o principal é que um dos marujos tenta estuprar Lilli. O casal então questiona se quer ou não voltar para a civilização.","first_air_date":"1991-08-02","runtime":102,"episode_run_time":[102],"vote_average":6.2,"created_by":["Price Entertainment","Columbia Pictures"],"production_companies":[{"name":"Price Entertainment"},{"name":"Columbia Pictures"}],"cast":["Milla Jovovich","Brian Krause","Lisa Pelikan","Courtney Barilla","Garette Ratliff Henson"],"backdrop_path":"https://image.tmdb.org/t/p/original/70tfSdpFBXI8VzELLc015aN9kwa.jpg","poster_path":"https://image.tmdb.org/t/p/original/1Ok3ZAnUXJk4y0Ij4QCt1LyYX7b.jpg","certification":"12","genres":["Aventura","Drama"],"trailer":"N/A"},
