"380":{"id":"380","name":"Rain Man","slug":"rain-man","original_title":"Rain Man","overview":"Charlie (Tom Cruise), um jovem yuppie, fica sabendo que seu pai faleceu. Eles nunca se deram bem e não se viam há vários anos, mas ele vai ao enterro e, ao cuidar do testamento, descobre que herdou um Buick 1949 e algumas roseiras premiadas, enquanto um \"beneficiário\" tinha herdado três milhões de dólares. Curioso em saber quem herdou a fortuna, ele descobre que foi seu irmão Raymond (Dustin Hoffman), cuja existência ele desconhecia. Autista, Raymond é capaz de calcular problemas matemáticos com grande velocidade e precisão. Charlie sequestra o irmão da instituição onde ele está internado para levá-lo para Los Angeles e exigir metade do dinheiro, nem que para isto tenha que ir aos tribunais. É durante uma viagem cheia de pequenos imprevistos que os dois entenderão o significado de serem irmãos.","first_air_date":"1988-12-12","runtime":133,"episode_run_time":[133],"vote_average":7.8,"created_by":["United Artists","Star Partners II Ltd.","Guber/Peters Company","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"United Artists"},{"name":"Star Partners II Ltd."},{"name":"Guber/Peters Company"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Dustin Hoffman","Tom Cruise","Valeria Golino","Gerald R. Molen","Jack Murdock"],"backdrop_path":"https://image.tmdb.org/t/p/original/mrfbeWcjgSaZ9NEb0xJMR9xzSeB.jpg","poster_path":"https://image.tmdb.org/t/p/original/fwVbH7LKfEieydL0xfh9rzTatU0.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
