"10327":{"id":"10327","name":"Legalmente Loira 2","slug":"legalmente-loira-2","original_title":"Legally Blonde 2: Red, White & Blonde","overview":"Elle Woods vai para Washington, D.C. para expor suas ideias sobre direitos dos animais, mas é ignorada por todos os políticos. Ela logo percebe que circular pela Casa Branca pode ser até mais difícil do que encarar uma universidade de prestígio. Finalmente, Elle conhece a simpática congressista Victoria Rudd, que ajuda a jovem advogada a colocar o pé no Congresso. Infelizmente, Elle ainda precisa convencer todo o legislativo a ouvi-la.","first_air_date":"2003-07-02","runtime":95,"episode_run_time":[95],"vote_average":5.7,"created_by":["Metro-Goldwyn-Mayer","Marc Platt Productions","Type A Films"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"},{"name":"Marc Platt Productions"},{"name":"Type A Films"}],"cast":["Reese Witherspoon","Sally Field","Regina King","Jennifer Coolidge","Luke Wilson"],"backdrop_path":"https://image.tmdb.org/t/p/original/cVPnuuh9stB4b2So2kdMfscKiv.jpg","poster_path":"https://image.tmdb.org/t/p/original/zPTwoOdHMupVncmn3LveSGag4Mt.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
"2118":{"id":"2118","name":"Los Angeles: Cidade Proibida","slug":"los-angeles-cidade-proibida","original_title":"L.A. Confidential","overview":"Três policiais trabalham em um crime não resolvido em um café de Los Angeles. O tenente Exley quer vingar seu pai assassinado, e o ex-parceiro do agente White foi uma das vítimas. Enquanto isso, o sargento Vincennes divulga informações confidenciais a um magnata dos tabloides.","first_air_date":"1997-09-19","runtime":132,"episode_run_time":[132],"vote_average":7.8,"created_by":["Regency Enterprises","Warner Bros. Pictures","Wolper Organization"],"production_companies":[{"name":"Regency Enterprises"},{"name":"Warner Bros. Pictures"},{"name":"Wolper Organization"}],"cast":["Guy Pearce","Russell Crowe","Kevin Spacey","Kim Basinger","Danny DeVito"],"backdrop_path":"https://image.tmdb.org/t/p/original/fGbM2cqPauRu7ALFPSTDBH9FgpU.jpg","poster_path":"https://image.tmdb.org/t/p/original/qzm1HWSXC0M1Vpkkm4IjO0AgoY2.jpg","certification":"18","genres":["Crime","Mistério","Thriller"],"trailer":"N/A"},
"10601":{"id":"10601","name":"Peter Pan","slug":"peter-pan","original_title":"Peter Pan","overview":"Peter (Levi Miller) é um garoto de 12 anos que vive em um orfanato em Londres, no período da Segunda Guerra Mundial. Um dia, ele e várias crianças são sequestradas por piratas em um navio voador, que logo é perseguido por caças do exército britânico. O navio escapa e logo ruma para a Terra do Nunca, um lugar mágico e distante onde o capitão Barba Negra (Hugh Jackman) escraviza crianças e adultos para que encontrem pixum, uma pedra preciosa que concentra pó de fada. Em pleno garimpo, Peter conhece James Hook (Garreth Hedlund), que tem planos para fugir do local.","first_air_date":"2003-12-18","runtime":115,"episode_run_time":[115],"vote_average":7.1,"created_by":["Universal Pictures","Columbia Pictures","Revolution Studios","Red Wagon Entertainment","Allied Stars"],"production_companies":[{"name":"Universal Pictures"},{"name":"Columbia Pictures"},{"name":"Revolution Studios"},{"name":"Red Wagon Entertainment"},{"name":"Allied Stars"}],"cast":["Jason Isaacs","Jeremy Sumpter","Rachel Hurd-Wood","Lynn Redgrave","Richard Briers"],"backdrop_path":"https://image.tmdb.org/t/p/original/zyWbOvKCdA9V9P5xuUG2eiPYsUo.jpg","poster_path":"https://image.tmdb.org/t/p/original/6QdU3TZZrIvXFzoHOwafZAynFjB.jpg","certification":"L","genres":["Aventura","Fantasia","Família"],"trailer":"N/A"},
"10330":{"id":"10330","name":"Sexta-Feira Muito Louca","slug":"sexta-feira-muito-louca","original_title":"Freaky Friday","overview":"Tess e Anna são mãe e filha que vivem às turras. Decididas a acabar com as brigas, elas repentinamente trocam de corpos. Agora cada uma precisa aprender a lidar com a vida da outra, com as confusões crescendo ainda mais pelo fato de Tess estar de casamento marcado.","first_air_date":"2003-08-05","runtime":97,"episode_run_time":[97],"vote_average":6.5,"created_by":["Casual Friday Productions","Gunn Films","Walt Disney Pictures"],"production_companies":[{"name":"Casual Friday Productions"},{"name":"Gunn Films"},{"name":"Walt Disney Pictures"}],"cast":["Lindsay Lohan","Jamie Lee Curtis","Harold Gould","Chad Michael Murray","Mark Harmon"],"backdrop_path":"https://image.tmdb.org/t/p/original/aH4MrSu8fwjRiEMGfdRwpsYu2PW.jpg","poster_path":"https://image.tmdb.org/t/p/original/zcCZ7LaN6Ly20Tu6Hdw44RRiBEI.jpg","certification":"N/A","genres":["Comédia","Família","Fantasia"],"trailer":"N/A"},
