"525":{"id":"525","name":"Os Irmãos Cara de Pau","slug":"os-irmaos-cara-de-pau","original_title":"The Blues Brothers","overview":"Após deixar a cadeia Jake reencontra seu irmão Elwood e juntos vão para o orfanato onde foram criados. Lá eles descobrem que o local será fechado se uma dívida de US$ 5 mil com a prefeitura não for paga. Como a freira que dirige o orfanato não aceita de forma alguma dinheiro ganho desonestamente, Jake e Elwood decidem por retomar a The Blues Brothers Band, na intenção de realizar um grande show e arrecadar a quantia necessária para pagar a dívida.","first_air_date":"1980-06-16","runtime":133,"episode_run_time":[133],"vote_average":7.7,"created_by":["Universal Pictures"],"production_companies":[{"name":"Universal Pictures"}],"cast":["Dan Aykroyd","John Belushi","James Brown","Cab Calloway","Ray Charles"],"backdrop_path":"https://image.tmdb.org/t/p/original/bk2fTuIhQIvdAA3RbnrnvLvuaTc.jpg","poster_path":"https://image.tmdb.org/t/p/original/N6bV5I9eNCwODbZ4XOtqK0IcTH.jpg","certification":"14","genres":["Música","Comédia","Ação","Crime"],"trailer":"Vb5DHpzRiLE"},
