"2978":{"id":"2978","name":"Os Caça-Fantasmas 2","slug":"os-caca-fantasmas-2","original_title":"Ghostbusters II","overview":"Após uma agitada caça viscosa a um fantasma, que custou milhões a cidade de Nova York, os Caça-Fantasmas encontram-se sem trabalho. Enquanto isso, um antigo tirano prepara sua volta para dominar a Terra usando seu retrato que está no Museu de Arte de Manhattan e possuindo o bebê de Dana Barrett como lar de sua maligna alma! Com a ajuda do enfeitiçado curador do museu, ele planeja tornar Nova York um assustador lugar para se viver! Usando seus equipamentos contra pestes paranormais, apenas os Caça Fantasmas podem salvar a cidade!","first_air_date":"1989-06-16","runtime":108,"episode_run_time":[108],"vote_average":6.6,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Bill Murray","Dan Aykroyd","Sigourney Weaver","Harold Ramis","Rick Moranis"],"backdrop_path":"https://image.tmdb.org/t/p/original/qBAfvEIpywGYknzOGGzrif7C4Qu.jpg","poster_path":"https://image.tmdb.org/t/p/original/hacjLeFkaqtsb3r9waXUeSoPUnn.jpg","certification":"10","genres":["Comédia","Fantasia"],"trailer":"N/A"},
